import React, { useContext, useState } from "react";
import useEth from "../../contexts/EthContext/useEth";

const SITNFT = () => {
  const {
    state,
    testFunct,
    makeAdmin
  } = useEth();
  // console.log(state.artifact);
  // console.log(state.contractSS);
  // console.log(state.contractsitnft.methods);

  return (
    <div className='page-two container'>
      <h2 className="pb-2 border-bottom text-start mt-5">SITNFT.</h2>
      <div className="row g-3 mt-3">
        <div className="col-sm-6">
          <label htmlFor="firstName" className="form-label">First name</label>
          <input type="text" className="form-control" id="firstName" placeholder="" required="" />
          <div className="invalid-feedback">
            Valid first name is required.
          </div>
        </div>
        <div className="col-sm-6">
          <label htmlFor="lastName" className="form-label">Last name</label>
          <input type="text" className="form-control" id="lastName" placeholder="" required="" />
          <div className="invalid-feedback">
            Valid last name is required.
          </div>
        </div>
      </div>
      <div className="col-sm-12 text-end">
        <button className="btn btn-block btn-primary mt-3" type="button" onClick={testFunct}>Submit</button>
      </div>
      <div className="col-sm-12 text-end">
        <button className="btn btn-block btn-primary mt-3" type="button" onClick={makeAdmin}>Submit</button>
      </div>
    </div>
  );
};

export default SITNFT;
